@58paulb @standardnews @George_Osborne Oh really?

You don't remember the fuel shortage then?

You're conveniently forgetting what happens when goods can't get to us for a few days/weeks.

@maneLFC44 @standardnews How is it bollocks? 

Do you remember the fuel shortage in the early 2000s? I was a police officer then and it was no fucking joke.

Planning now to have the army on standby is a sensible move. It'll be required.
